// download pdf version 

downloadPDF(){
  this.req={
    id:this.id,
    name:this.sname,
    department:this.selecteddepartment,
    minSal:this.minSalary,
    maxSal:this.maxSalary
  };
  this.employeedataservice.GetAllEmployeeVehicleForPDF(this.req).subscribe(
    data=>{
      const doc= new jsPDF;
      doc.text('Employee List',14,20)
      const col =['ID','NAME','DEPARTMENT','ADDRESS','SALARY','Vehicle ID', 'Vehicle Number','Vehicle SPOT','Joining Id','Joining Date'];
      const rows:any[]=[]
      console.log(data);
      
       data.forEach(emp=>{
        const temp= [emp.id,emp.name,emp.department,emp.address,emp.salary,emp.vehicleId,emp.vehicleNumber,emp.vehicleSpot,emp.joiningID,emp.joiningDate];
        rows.push(temp);
       });
       (doc as any).autoTable({
        head:[col],
        body:rows,
        startY:25
       });
       
       doc.save('EmployeeList.pdf')
    } 
  )
 
}

