public exportExcelEmployeeWithVehicleAndJoiningDate(employee:EmployeeVehicleDTO[],fileName:string){
  const workbook=new ExcelJS.Workbook();
  console.log(employee);
  
  const worksheet = workbook.addWorksheet('EMPLOYEE DATA');


  // ADD HEADING 
 
    // adding heading 
    const titleName = worksheet.getCell('C1')
    const titile = 'EMPLOYEE DATA'
    worksheet.mergeCells('C1:D3');
    titleName.value = titile
    titleName.alignment = { horizontal: 'center' , vertical:'middle' }
    titleName.font = { bold: true }







    // adding date to the excel 
    const dateCell = worksheet.getCell('E1')
    const currentDate = new Date().toLocaleDateString();
    worksheet.mergeCells('E1:E3');

    dateCell.value = `${currentDate}`
    dateCell.font = { bold: true, }
    dateCell.alignment={horizontal:'center', vertical:'middle'}

    // adding Logo 


    const imgCell= worksheet.getCell('F1')
    worksheet.mergeCells('A1:B3')
    const logo=workbook.addImage({
      base64:'data:image/png;base64,',

      extension:'jpeg',
    })
    worksheet.addImage(logo,'A1:B3');

    
  




    worksheet.addRow([])
    worksheet.addRow(['id', 'Name', 'Department', 'Address', 'Salary','Vehicle ID','Vehicle No','Parking Spot','Joining ID', 'Joining Date']);
    worksheet.getRow(3).font = { bold: true, };
    worksheet.getColumn(1).width = 8;
    worksheet.getColumn(2).width = 15;
    worksheet.getColumn(3).width = 15;
    worksheet.getColumn(4).width = 17;
    worksheet.getColumn(5).width = 20;
    worksheet.getColumn(6).width = 20;
    worksheet.getColumn(7).width = 20;
    worksheet.getColumn(8).width = 20;
    worksheet.getColumn(9).width = 20;
    worksheet.getColumn(10).width = 20;



    // worksheet.getColumn(6).width = 12;


    //defining the headers 
    // worksheet.columns=[
    //   {header:'Id', key:'id',width:10},
    //   {header:'Name', key:'name',width:25},
    //   {header:'Department', key:'department',width:20},
    //   {header:'Address', key:'address',width:30},
    //   {header:'Salary', key:'salary',width:10},

    // ]
    worksheet.getRow(6).font = { bold: true }
    

    employee.forEach(employee => {

      const row =worksheet.addRow([employee.id, employee.name, employee.address, employee.department, employee.salary, employee.vehicleId,employee.vehicleNumber,employee.vehicleSpot, employee.joiningID,employee.joiningDate])
      row.eachCell({includeEmpty:true},(cell:ExcelJS.Cell)=>{
        cell.alignment={horizontal:'center', vertical:'middle'}
      })
      
    })


    

    //appliying border 
    const startRow = 5
    
    const rows = worksheet.getRows(startRow, employee.length + 1);
    if (rows) {
      rows.forEach(row => {
        row.eachCell(cell => {
          cell.border = {
            top: { style: 'thin'  },
            left: { style: 'thin' },
            bottom: { style: 'thin' },
            right: { style: 'thin' }
      
          }
          
        })
      })
    }

    //Generating excel file and downloading
    workbook.xlsx.writeBuffer().then((buffer: ArrayBuffer) => {
      this.saveExcelFile(buffer, fileName);
    })






  }
  private saveExcelFile(bufer: ArrayBuffer, fileName: string): void {
    const data: Blob = new Blob([bufer], { type: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet' });
    const url = window.URL.createObjectURL(data);
    const link = document.createElement('a');
    link.href = url;
    link.download = fileName + '.xlsx';
    link.click();
    window.URL.revokeObjectURL(url);
    link.remove();
  
 }







